import React, {useRef, useState, useEffect, useContext} from 'react';
import SwipeableViews from 'react-swipeable-views';
import { useTheme } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import PastTrainingTable from '../past-training-table/Past-training-table';
import {exercises} from '../../Exercises';
import CurrentTrainingTab from '../current-training/current-training-tab/CurrentTrainingTab';
import { TabPanel } from '../../TabPanel/TabPanel';
import { AuthContext } from '../../auth/AuthContext';

function a11yProps(index) {
  return {
    id: `full-width-tab-${index}`,
    'aria-controls': `full-width-tabpanel-${index}`,
  };
}

export default function TrainingTab() {


  const theme = useTheme();

  const interval = useRef(0);
  const currentExercise = useRef('');

  const [value, setValue] = useState(0);
  const [progress, setProgress] = useState(0);
  const [exercise, setExercise] = useState('');
  const [loading, setLoading] = useState(false);
  const {uid} = useContext(AuthContext);

  const handleExerciseChange = (event) => {
    if(event.target.value !== 0) {
      setExercise(event.target.value);
    }
    return;
  };

  const handleTabChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleTabChangeIndex = (index) => {
    setValue(index);
  };

  useEffect(() => {
    currentExercise.current = exercises.find( ex => ex.id === exercise);

    if(currentExercise.current){

      let duration = currentExercise.current.duration / 100 * 1000;

      if(loading) {
          interval.current = setInterval(()=> {
            setProgress((prevProgress) => (prevProgress >= 100 ? 10 : prevProgress + 1))
          }, duration);
      }

      let data;
      if (progress >= 100) {
          setLoading(false);
          clearInterval(interval.current);
            data = {
            ...currentExercise.current,
            id: currentExercise.current.name, 
            duration: currentExercise.current.duration * (progress / 100),
            calories: currentExercise.current.calories * (progress / 100),
            date: ( new Date() ).toLocaleDateString().split("."),
            status: "Completed",
            exUserId: uid
          };
          const sendData = async () => {
            try {
              let response = await fetch(
                'https://training-app-d460e.firebaseio.com/exercises.json', {
                method: "POST",
                headers: {'Content-Type': 'application/json'},
                body: JSON.stringify(data)
                })
              response.json()
            }
            catch(err) {}

        }
        sendData();  
      }  

      return () => clearInterval(interval.current) }
    }, [loading, progress, exercise, uid ]);


    const startTraining = () => {
        setLoading(true);
    }

    const cancelTraining = async () => {

      clearInterval(interval.current);
      setProgress(0);
      setLoading(false);
      window.location.reload();

      const data = {
        ...currentExercise.current,
        exUserId: uid,
        id: currentExercise.current.name, 
        duration: currentExercise.current.duration * (progress / 100),
        calories: currentExercise.current.calories * (progress / 100),
        date: ( new Date() ).toLocaleDateString().split("."),
        status: "cancelled",
      };

      try {
        let responseData =  await fetch(
          'https://training-app-d460e.firebaseio.com/exercises.json', {
            method: "POST",
            headers: {'Content-Type': 'application/json'},
            body: JSON.stringify(data)
            }
          );

        responseData.json();
      }
      catch(err) {
        console.log(err.message);
      }      
    }

  return (
    <div >
      <AppBar position="static" color="default">
        <Tabs
          value={value}
          onChange={handleTabChange}
          indicatorColor="primary"
          textColor="primary"
          variant="fullWidth"
          aria-label="full width tabs example"
        >
          <Tab label="Current Training" {...a11yProps(0)} />
          <Tab label="Past Training" {...a11yProps(1)} />
        </Tabs>
      </AppBar>
      <SwipeableViews
        axis={theme.direction === 'rtl' ? 'x-reverse' : 'x'}
        index={value}
        onChangeIndex={handleTabChangeIndex}
      >
        <TabPanel value={value} index={0} dir={theme.direction}>
            <CurrentTrainingTab
             exercise={exercise}
             handleExerciseChange={handleExerciseChange}
             loading={loading}
             progress={progress}
             cancelTraining={cancelTraining}
             startTraining={startTraining}
              />
        </TabPanel>
        <TabPanel value={value} index={1} dir={theme.direction}>
          <PastTrainingTable  />
        </TabPanel>

      </SwipeableViews>
    </div>
  );
}
